  \"2014-07-15T13:00:39.437141\",\n\t\"name\": \"urban-growth-projection-for-southeast-regional-assessment-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset represents the extent of urbanization
  (for the year indicated) predicted by the model SLEUTH, developed by Dr. Keith C.
  Clarke, at the University of California, Santa Barbara, Department of Geography
  and modified by David I. Donato of the United States Geological Survey (USGS) Eastern
  Geographic Science Center (EGSC). Further model modification and implementation
  was performed at the Biodiversity and Spatial Information Center at North Carolina
  State University. Purpose: Urban growth probability extents throughout the 21st
  century for the Southeast Regional Assessment Project, which encompasses the states
  of Alabama, Florida, Georgia, Kentucky, Mississippi, North Carolina, South Carolina,
  Tennessee and Virginia and parts of the states of Arkansas, Illinois, Indiana, Louisiana,
  Maryland, Missouri, Ohio and West Virginia. Credit: Southeast Regional Assessment
  Project; Biodiversity and Spatial Information Center, North Carolina State University,
  Raleigh, North Carolina 27695, Curtis M. Belyea. Use Limitation: This data set is
  not intended for site-specific analyses. Interpretations derived from its use are
  suited for regional and planning purposes only. These data are not intended to be
  used at scales larger than 1:100,000. Acknowledgment of Biodiversity and Spatial
  Analysis Center at North Carolina State University is appreciated.\",\n\t\"license_title\":
